import { useEffect, useState } from "react";
import { Button } from "@/components/ui/button";
import { Card, CardContent } from "@/components/ui/card";
import { Input } from "@/components/ui/input";
import { Dialog, DialogContent, DialogTrigger } from "@/components/ui/dialog";

const API_URL = "http://localhost:3000/contacts"; // Change this to your backend URL

export default function ContactsApp() {
  const [contacts, setContacts] = useState([]);
  const [form, setForm] = useState({ first_name: "", last_name: "", email: "", phone_number: "" });
  const [editing, setEditing] = useState(null);
  const [history, setHistory] = useState([]);
  const [showHistory, setShowHistory] = useState(false);

  const fetchContacts = async () => {
    const res = await fetch(API_URL);
    const data = await res.json();
    setContacts(data);
  };

  useEffect(() => {
    fetchContacts();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const method = editing ? "PUT" : "POST";
    const url = editing ? `${API_URL}/${editing.id}` : API_URL;
    await fetch(url, {
      method,
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(form),
    });
    setForm({ first_name: "", last_name: "", email: "", phone_number: "" });
    setEditing(null);
    fetchContacts();
  };

  const handleDelete = async (id) => {
    await fetch(`${API_URL}/${id}`, { method: "DELETE" });
    fetchContacts();
  };

  const handleEdit = (contact) => {
    setForm(contact);
    setEditing(contact);
  };

  const handleViewHistory = async (id) => {
    const res = await fetch(`${API_URL}/${id}/history`);
    const data = await res.json();
    setHistory(data);
    setShowHistory(true);
  };

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">Contacts</h1>

      <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-6">
        <Input name="first_name" placeholder="First Name" value={form.first_name} onChange={handleChange} required />
        <Input name="last_name" placeholder="Last Name" value={form.last_name} onChange={handleChange} required />
        <Input name="email" placeholder="Email" value={form.email} onChange={handleChange} required />
        <Input name="phone_number" placeholder="Phone Number" value={form.phone_number} onChange={handleChange} required />
        <div className="col-span-full">
          <Button type="submit">{editing ? "Update" : "Create"} Contact</Button>
        </div>
      </form>

      <div className="grid gap-4">
        {contacts.map((contact) => (
          <Card key={contact.id}>
            <CardContent className="p-4 flex flex-col md:flex-row justify-between items-center gap-2">
              <div>
                <div className="font-medium">
                  {contact.first_name} {contact.last_name}
                </div>
                <div className="text-sm text-gray-500">{contact.email}</div>
                <div className="text-sm text-gray-500">{contact.phone_number}</div>
              </div>
              <div className="flex gap-2">
                <Button variant="outline" onClick={() => handleEdit(contact)}>
                  Edit
                </Button>
                <Button variant="destructive" onClick={() => handleDelete(contact.id)}>
                  Delete
                </Button>
                <Dialog>
                  <DialogTrigger asChild>
                    <Button variant="secondary" onClick={() => handleViewHistory(contact.id)}>
                      History
                    </Button>
                  </DialogTrigger>
                  <DialogContent>
                    <h2 className="text-lg font-semibold mb-2">Edit History</h2>
                    <ul className="text-sm space-y-2">
                      {history.length === 0 ? (
                        <li>No history available</li>
                      ) : (
                        history.map((entry, index) => (
                          <li key={index}>
                            <div>{new Date(entry.edited_at).toLocaleString()}</div>
                            <pre className="bg-gray-100 p-2 rounded">
                              {JSON.stringify(entry.changes, null, 2)}
                            </pre>
                          </li>
                        ))
                      )}
                    </ul>
                  </DialogContent>
                </Dialog>
              </div>
            </CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
}
